import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './pages/HomePage';
import AdminDashboard from './pages/AdminDashboard';
import Navbar from './components/Navbar';
import SuccessPage from './pages/SuccessPage'; 


function App() {
  return (
    <Router>
      <div className="App">
        {/* Simple Link Bar for your Demo */}
        <div style={{ backgroundColor: '#212121', color: 'white', padding: '10px 50px', fontSize: '12px', display: 'flex', gap: '20px' }}>
          <Link to="/" style={{ color: 'white', textDecoration: 'none' }}>View Store</Link>
          <Link to="/admin" style={{ color: 'white', textDecoration: 'none' }}>Admin Dashboard</Link>
        </div>
        
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/admin" element={<AdminDashboard />} />
          <Route path="/success" element={<SuccessPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
